import List from '../component/List'
import BookmarkList from '../component/BookmarkList'
import { useEffect } from 'react'

export default function Main({filter, list}){
  useEffect(()=>{
    const productList = list.filter(el=>el.type==='Product')
    const categoryList = list.filter(el=>el.type==='Category')
    const exhibitionList = list.filter(el=>el.type==='Exhibition')
    const brandList = list.filter(el=>el.type==='Brand')
  },[])

  const items = [productList[0],categoryList[0],exhibitionList[0],brandList[0]]
  return(
    <article id='main'>
      <section>
      <dl>
        <dt>상품 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} />
          })}
        </dd>
        <dt>북마크 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} />
          })}
        </dd>
      </dl>
      </section>
    </article>
  )
}
